import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Blog from './Blog';
import Banner from './Banner';
import Footer from './Footer';

const Home = () => (
  <div>
    <Banner />
    <Blog />
    <img id="left-pic" src="https://cdn.thecollector.com/wp-content/uploads/2023/04/hp-lovecraft-cthulhu-mythos.jpg?width=1400&quality=55" alt="Banner" />
    <img id="logo" src="logo2.png"/>
  </div>
);

const Contact = () => (
  <div>
  <Banner />
  <p>Johan Kringstad</p>
  <p>johan.kringstad@outlook.com</p>
  <Footer />
  </div>
);

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
